import { StatusBar } from 'expo-status-bar';
import React, { useState, useEffect } from 'react';
import { StyleSheet, Text, View, SafeAreaView } from 'react-native';
import { Provider as PaperProvider } from "react-native-paper";

import HomeScreen from './components/1_HomeScreen/HomeScreen';
import SwapNumbers from './components/1_HomeScreen/SwapNumbers';
import IntoTheDiamond from './components/1_HomeScreen/IntoTheDiamond';
import KeepMeInMemory from './components/1_HomeScreen/KeepMeInMemory';

import AuthScreen from './components/2_AuthScreen/AuthScreen';
import Login from './components/2_AuthScreen/Login';
import SignUp from './components/2_AuthScreen/SignUp';

import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

const Stack = createStackNavigator();

export default function App() {

  const [placeholder, setPlaceholder] = useState("");

  useEffect(() => {

    fetch('http://localhost:5000/api/user/1')
    .then(res => res.json())
    .then(data => {
      setPlaceholder(data.username);
    });
  }, []);

  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Home">
        <Stack.Screen name="Home" component={HomeScreen} />
        <Stack.Screen name="SwapNumbers" component={SwapNumbers} />
        <Stack.Screen name="IntoTheDiamond" component={IntoTheDiamond} />
        <Stack.Screen name="KeepMeInMemory" component={KeepMeInMemory} />

        <Stack.Screen name="Auth" component={AuthScreen} />
        <Stack.Screen name="Login" component={Login} />
        <Stack.Screen name="SignUp" component={SignUp} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
